using ShineEngine;

/// <summary>
/// 匹配超时消息(generated by shine)
/// </summary>
public class FuncMatchTimeOutResponse:FuncSResponse
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=GameResponseType.FuncMatchTimeOut;
	
	public FuncMatchTimeOutResponse()
	{
		_dataID=GameResponseType.FuncMatchTimeOut;
	}
	
	/// <summary>
	/// 执行
	/// </summary>
	protected override void execute()
	{
		me.scene.setMatchingFuncID(-1);
		//暂时也用cancelMatch
		me.dispatch(GameEventType.CancelMatch);

		GameC.scene.onMatchTimeOut(funcID);
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "FuncMatchTimeOutResponse";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		base.toReadBytesFull(stream);
		
		stream.startReadObj();
		
		stream.endReadObj();
	}
	
}
